    },
    BeforeCreated: function (entity) {
        entity.GroupFee = entity.GroupFee;
        var detail = this.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "BookingDetail");
        if (detail && detail.AllListViewItem && detail.AllListViewItem.length == 0) {
            return;
        }
        var lastItem = detail.AllListViewItem[detail.AllListViewItem.length - 1];
        entity.VendorId = entity.VendorId == null ? lastItem.Entity.VendorId || null : entity.VendorId;
    },
    AddDuplicateMenu: function (form, gridview) {
        gridview.MenuItems.push({
            Icon: "fal fa-folders",
            Text: "Duplicate",
            Click: () => this.DuplicateFee(form, gridview)
        });
    },
    DuplicateFee: function (form, gridview) {
        var defaultFee = form.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "BookingDetail");
        var newItem = JSON.parse(JSON.stringify(defaultFee.Header.filter(x => x.FieldName == "VendorId" || x.FieldName == "IsBuying")));
        newItem.forEach(item => {
            item.FieldName = "View" + item.FieldName;
        })
        var form = this.EditForm.OpenConfig("Please select Payer/Payee!", () => {
            debugger;
            if (!form.Entity.ViewVendorId) {
                return;
            }
            var selecteds = defaultFee.AllListViewItem.filter(x => !x.GroupRow && x.Selected);
            var newFees = JSON.parse(JSON.stringify(selecteds.map(x => x.Entity)));
            newFees.forEach(item => {
                item.Id = this.Uuid7.NewGuid();
                item.VendorId = form.Entity.ViewVendorId;
                item.IsBuying = form.Entity.ViewIsBuying;
                if (!item.IsObh) {
                    item.Amount = null;
                    item.TotalAmount = null;
                    item.AmountTax = null;
                    item.TotalAmountTax = null;
                }
                item.IsBuying = this.EditForm.Entity.ViewIsBuying;
            });
            defaultFee.LoadMasterData(newFees).then(() => {
                defaultFee.ClearSelected();
                defaultFee.AddRows(newFees).then(rows => {
                    rows.forEach(row => {
                        row.Selected = true;
                    });
                    rows[0].Element.focus();
                    var detail = form.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "Summary");
                    detail.ReloadData();
                });
            });
        }, () => { }, true, newItem);
    },
